INSERT INTO `tblpopup` (`Guid_popup`, `key`, `definition`) VALUES
(1, 'bilateral', 'Tumor in the opposite breast diagnosed within 6 months following the detection of the first cancer.'),
(12, 'mismatch repair deficiency', 'Cells that have mutations in the MMR genes (MLH1, MSH2, MSH6, and PMS2) that are involved in DNA repair'),
(2, 'contralateral', 'Tumor in the opposite breast diagnosed more than 6 months following the detection of the first cancer.'),
(3, 'ipsilateral', 'Tumor affecting the same side of the body.'),
(11, 'synchronous', 'Existing or happening at the same time.'),
(4, 'synchronously', 'Existing or happening at the same time.'),
(5, 'asynchronously', 'Not happening at the same time.'),
(6, 'metachronous', 'Multiple primary tumors developing at intervals.'),
(7, 'triple negative', 'Individual\'s breast cancer cells test negative for estrogen receptors (ER negative), progesterone receptors (PR negative), and human epidermal growth factor receptors (HER2 negative).'),
(8, 'metastatic', 'Cancer spreading to a different part of the body from where it started.'),
(9, 'Gleason score &ge; 7', 'Aggressive and high-grade cancerous cells.'),
(10, 'limited family structure', 'Member who has fewer than two first- or second- degree female relatives in the same lineage (maternal or paternal) that lived to age 45.'),
(13, 'epithelial ovarian cancer', 'Most common ovarian cancer that starts in the surface layer covering the ovary.'),
(15, 'Microsatellite Instability', 'Abnormal change in the number of units in microsatellite DNA sequences in a tumor due to defects in the DNA mismatch repair (MMR) proteins (MLH1, MSH2, MSH6, and PMS2)'),
(17, 'MMR gene mutation', 'The MMR (mismatch repair) genes are PMS2, MLH1, MSH2, and MSH6');
